import React, {useState, useEffect} from 'react';
import { SafeAreaView, StatusBar, Image, View, Text, StyleSheet } from 'react-native';
import 'react-native-gesture-handler'
import Navigation from './src/navigation'
// import styles from './src/styles/styles.js';
import SplashScreen from 'react-native-splash-screen'
import MainService from './src/navigation/mainService'

const landingImage = require('./src/images/landingPage.png')

export default class App extends React.Component {
  state = {
    loaded: false
  }
  constructor(){
    super()
    MainService.load(v => this.setState({loaded: true}))
  }
  render(){
  return (
    // <>
    //   <StatusBar barStyle="light-content" />
    //     <SafeAreaView style={{flex: 1, backgroundColor: 'black'}}>
    //         <Navigation />
    //     </SafeAreaView>
    // </>
    <View style={styles.container}>
      {this.state.loaded ? <Text>Welcome!</Text> : <Text>Loading...</Text>}
    </View>
  );
};
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'white',
    alignItems: 'center',
    justifyContent: 'center',
  }
})



